import React, { useState } from "react";
import { ScrollView, TextInput, TouchableOpacity } from "react-native";
import { Image, StyleSheet, Text, View } from "react-native";
import { collection, getDocs } from "firebase/firestore";

const menu = require("../../assets/icons/menu.png");
const face = require("../../assets/face1.png");
const magnifying_glass = require("../../assets/icons/magnifying-glass.png");

const image_v_1 = require("../../assets/vehicles/v-1.png");
const image_v_2 = require("../../assets/vehicles/v-2.png");
const image_v_3 = require("../../assets/vehicles/v-3.png");
const image_v_4 = require("../../assets/vehicles/v-4.png");

import data from "../../database/vehicles.json";

const HomeScreen = ({ navigation }) => {
  const [vehicles, setVehicles] = useState(data.vehicles);
  const [filteredVehicles, setFilteredVehicles] = useState(data.vehicles);

  const getImage = (id) => {
    if (id == 1) return image_v_1;
    if (id == 2) return image_v_2;
    if (id == 3) return image_v_3;
    if (id == 4) return image_v_4;
  };

  const searchVehicles = (keyword) => {
    const lowercasedKeyword = keyword.toLowerCase();
    const results = vehicles.filter((vehicle) =>
      vehicle.make.toLowerCase().includes(lowercasedKeyword)
    );
    console.log("Filtered Vehicles:", results);
    setFilteredVehicles(results);
  };

  return (
    <ScrollView style={styles.scrollView}>
      <View style={styles.safeArea}>
        <View style={styles.container}>
          <View style={styles.headerSection}>
            <Image
              source={menu}
              resizeMode="contain"
              style={styles.menuIconStyle}
            />
            <Image
              source={face}
              resizeMode="contain"
              style={styles.faceIconStyle}
            />
          </View>

          <View style={styles.titleSection}>
            <Text style={styles.title}>Rent a Car</Text>
          </View>

          <View style={styles.searchSection}>
            <View style={styles.searchPallet}>
              <TextInput
                style={styles.searchInput}
                placeholder="Search a Car"
                onChangeText={(text) => searchVehicles(text)}
              />
              <View style={styles.searchIconArea}>
                <Image
                  source={magnifying_glass}
                  resizeMode="contain"
                  style={styles.magnifyingIconStyle}
                />
              </View>
            </View>
          </View>

          <View style={styles.listSection}>
            <Text style={styles.headText}>Most Rented</Text>

            {filteredVehicles.map((vehicle) => (
              <TouchableOpacity
                style={styles.element}
                key={vehicle.id}
                activeOpacity={0.8}
                onPress={() =>
                  navigation.navigate("Info", { id: vehicle.id })
                }
              >
                <View style={styles.infoArea}>
                  <Text style={styles.infoTitle}>
                    {vehicle.make} {vehicle.model}
                  </Text>
                  <Text style={styles.infoSub}>
                    {vehicle.type}-{vehicle.transmission}
                  </Text>
                  <Text style={styles.infoPrice}>
                    <Text style={styles.infoAmount}>
                      ${vehicle.price_per_day}{" "}
                    </Text>
                    /day
                  </Text>
                </View>
                <View style={styles.imageArea}>
                  <Image
                    source={getImage(vehicle.id)}
                    resizeMode="contain"
                    style={styles.vehicleImage}
                  />
                </View>
              </TouchableOpacity>
            ))}
          </View>
        </View>
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  scrollView: {
    flex: 1,
    backgroundColor: "#e7e7e7",
  },
  safeArea: {
    flex: 1,
  },
  container: {
    flex: 1,
    paddingHorizontal: 20,
    paddingTop: 10,
  },
  headerSection: {
    height: 70,
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: 20,
  },
  menuIconStyle: {
    width: 30,
  },
  faceIconStyle: {
    width: 40,
  },
  titleSection: {
    marginTop: 8,
    marginBottom: 10,
  },
  title: {
    fontSize: 32,
    fontWeight: "600",
  },
  searchSection: {
    marginTop: 15,
    paddingLeft: 15,
    paddingRight: 15,
    justifyContent: "center",
    marginBottom: 10,
  },
  searchPallet: {
    paddingLeft: 10,
    paddingRight: 10,
    flexDirection: "row",
    borderRadius: 8,
    width: "80%",
    height: 30,
    backgroundColor: "white",
  },
  searchInput: {
    width: 245,
    height: 30,
    backgroundColor: "white",
  },
  searchIconArea: {
    width: 30,
    height: 30,
    justifyContent: "center",
    alignItems: "center",
  },
  magnifyingIconStyle: {
    width: 24,
    height: 24,
    marginRight: -10,
  },
  typesSection: {
    marginTop: 15,
    flexDirection: "row",
    marginBottom: 10,
  },
  typesTextActive: {
    fontSize: 15,
    marginRight: 34,
    fontWeight: "bold",
    color: "black",
  },
  typesText: {
    fontSize: 15,
    marginRight: 33,
    fontWeight: "500",
    color: "#696969",
  },
  listSection: {
    marginTop: 10,
  },
  headText: {
    fontSize: 18,
    fontWeight: "bold",
    marginBottom: 10,
  },
  element: {
    height: 100,
    padding: 15,
    borderRadius: 10,
    backgroundColor: "white",
    flexDirection: "row",
    marginBottom: 13,
  },
  infoArea: {
    flex: 1,
  },
  infoTitle: {
    fontSize: 15,
    fontWeight: "bold",
  },
  infoSub: {
    fontSize: 11,
    fontWeight: "600",
    color: "#696969",
  },
  infoPrice: {
    position: "absolute",
    bottom: 0,
    fontSize: 10,
    color: "#696969",
    fontWeight: "bold",
  },
  infoAmount: {
    fontSize: 12,
    color: "black",
    fontWeight: "600",
  },
  imageArea: {
    flex: 1,
  },
  vehicleImage: {
    position: "absolute",
    top: -15,
    left: -15,
    width: "140%",
    height: "140%",
  },
});

export default HomeScreen;
